Маска является уникальным средством в борьбе с увяданием и преждевременным старением кожи. Это особенно актуально для женщин, которые перешагнули за отметку в 25 лет. 
Нам понадобиться:
- дрожжи – 2 ч.л.;
- 6 ч.л. теплого молока;
-1 ч.л. меда;
-3 ч.л. крахмала;
- витамин Е и витамин А.
Маску можно сделать 1 раз и сразу ощутить эффект, но лучше всего не останавливаться и продолжить делать каждый день на протяжении 2 недель. Салонные процедуры отдыхают!
Если взяться за дело ответственно, можно получить умопомрачительный результат от применения маски. С утра проснетесь – морщины…Куда же они подевались?
